  isAuthenticate = (): boolean => {
    let isAuth: boolean;
    if (localStorage.getItem("token")!) {
      isAuth = true;
      this.authenticate.next(isAuth);
      return isAuth;
    } else {
      this.logout();
      isAuth = false;
      this.authenticate.next(isAuth);
      return isAuth;
    }
  };

